                //                         <Carousel.Caption className='carousel-caption' style={{ paddingLeft: '8%', paddingTop: '4%' }}>
                //                             <h2 >{product.name} </h2>
                //                             <h3>Only ${product.price} </h3>
                //                         </Carousel.Caption>
                //                     </Col>
                //                 </Row>
                //             </Link>

                //         </Carousel.Item>

                //     ))}
                // </Carousel>
                    < div className = "s-skeleton s-skeleton--h-600 s-skeleton--bg-black" >
                        <div className="owl-carousel primary-style-2" id="hero-slider">
                            <div className="hero-slide hero-slide--4">
                                <div className="primary-style-2-container">
                                    <div className="row">
                                        <div className="col-12">
                                            <div className="slider-content slider-content--animation">
                                                <span className="content-span-1 u-c-white">Find Top Brands</span>
                                                <span className="content-span-2 u-c-white">10% Off On Intimates</span>
                                                <span className="content-span-3 u-c-white">Find Intimates on best prices</span>
                                                <span className="content-span-4 u-c-white">Starting At
                                                    <span className="u-c-brand">$100.00</span></span>
                                                <a className="shop-now-link btn--e-brand" href="shop-side-version-2.html">SHOP NOW</a></div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div className="hero-slide hero-slide--5">
                                <div className="primary-style-2-container">
                                    <div className="row">
                                        <div className="col-12">
                                            <div className="slider-content slider-content--animation">
                                                <span className="content-span-1 u-c-white">Find Top Brands</span>
                                                <span className="content-span-2 u-c-white">10% Off On Electronics</span>
                                                <span className="content-span-3 u-c-white">Find electronics on best prices</span>
                                                <span className="content-span-4 u-c-white">Starting At
                                                    <span className="u-c-brand">$1000.00</span></span>
                                                <a className="shop-now-link btn--e-brand" href="shop-side-version-2.html">SHOP NOW</a></div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div className="hero-slide hero-slide--6">
                                <div className="primary-style-2-container">
                                    <div className="row">
                                        <div className="col-12">
                                            <div className="slider-content slider-content--animation">
                                                <span className="content-span-1 u-c-white">Find Top Brands</span>
                                                <span className="content-span-2 u-c-white">10% Off On Outwear</span>
                                                <span className="content-span-3 u-c-white">Find outwear on best prices</span>
                                                <span className="content-span-4 u-c-white">Starting At
                                                    <span className="u-c-brand">$100.00</span></span>
                                                <a className="shop-now-link btn--e-brand" href="shop-side-version-2.html">SHOP NOW</a></div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                </div >

            )
    )
}

export default ProductCarousel
